// App.js
import { Routes, Route } from "react-router-dom";
import { Company, Home } from "./components";

const App = () => {
  return (
    <>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/company/:companyId" component={Company} />

        {/* <Route path="/products" element={<Products />} /> */}
      </Routes>
    </>
  );
};

export default App;
